  CONSTRAINT `question_ibfk_1` FOREIGN KEY (`ym_id`) REFERENCES `yearmonth` (`ym_id`),
  CONSTRAINT `question_ibfk_2` FOREIGN KEY (`img_id`) REFERENCES `questionimage` (`img_id`),
